tables.table_schema:
CREATE TABLE demographic_data (
    id INT PRIMARY KEY,
    age INT,
    gender VARCHAR,
    income FLOAT
);

CREATE TABLE public_policy_decisions (
    id INT PRIMARY KEY,
    decision_name VARCHAR,
    description TEXT,
    impact_rating INT
);

CREATE TABLE public.demographic_data (
    id UUID PRIMARY KEY,
    age INT,
    gender VARCHAR(10),
    income DECIMAL
);

CREATE TABLE public.policy_preferences (
    policy_id UUID PRIMARY KEY,
    policy_name VARCHAR(50),
    support_level INT
);

CREATE TABLE public.policy_impacts (
    impact_id UUID PRIMARY KEY,
    policy_id UUID REFERENCES policy_preferences(policy_id),
    population_affected INT,
    impact_description TEXT
);
